/** @jsx jsx */
/** @jsxRuntime classic */
import { css, jsx } from "@emotion/core";
import HeroNav from "./HeroNav";


const Hero = () => {
    return(
        <section css={styles} className="hero">
            <HeroNav />
        </section>       
    );
};

const styles = css`
    width: 100%;
    min-height: 100vh;
    margin-left: 100px;
`;

export default Hero;
